  true,\n\t\"url\": null,\n\t\"notes\": \"Publicly available off-street parking in
  San Francisco as of September 2011. Find attached a data dictionary, a version of
  the map as a PDF (symbolized to show garage type and capacity of garage), and a
  shapefile and CSV of the data. This dataset includes location, capacities, and related
  details of public parking garages and lots; four parking categories: paid, publicly
  available (PPA): drive up and pay, typically by the hour or by the day; customer
  parking only (CPO): typically for businesses or religious institutions; permit holder
  only (PHO, CGO): i.e. employees only, students only, monthly only; free publicly
  available (FPA): free off-street parking. The data does not contain off-street residential
  parking spaces or other unmarked ufffdufffdufffdprivateufffdu06dd parking.\",\n\t\"license_title\":
